import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import CssBaseline from '@material-ui/core/CssBaseline';

ReactDOM.render(
  <React.StrictMode>
    <CssBaseline classes={{body: {"background-color": "red"}}} />
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
